import "./style.css"
const GifyModel= (props)=>{
 console.log(props.data);
    return(
        <div className= "gify_container">
            <input className="gify_inp"/>
            
              <img src ={props.data[0].images.original.url} alt = "loading..."/>
            
            <img src ={props.data[1].images.original.url} alt = "loading..."/>

            <img src ={props.data[2].images.original.url} alt = "loading..."/>

         
            <img src ={props.data[3].images.original.url} alt = "loading..."/>

         
          
            {
              props.data.forEach((el)=>{
                return(
                  <div className="tgs_gify">
                    <img src = {el.images.original.url} alt="loading.."/>
                  </div>
                )
              })
            }
         
        </div>
    )
}

export default GifyModel;
